<!DOCTYPE html>
<html>

<head>
  <meta charset="utf8" />
  <title>Hallucinations Collectives</title>
  <style type="text/css">
    html {
      height: 100%;
    }

    body {
      background: url("../assets/bg.png") no-repeat center center fixed;
      background-color: #FFDBD1;
      background-size: cover;
      height: 100%;
      margin: 0;
      padding: 0;
    }

    .menu-container {
      display: flex;
      width: 100%;
      height: 100%;
      align-items: center;
      justify-content: center;
    }

    .menu-container .logo {
      position: absolute;
      animation: rotation 30s infinite linear;
    }

    .menu-container .lines {
      position: absolute;
      display: flex;
    }

    .squiggle {
      animation: squiggling 1.2s infinite linear;
    }
    .title {
      display: flex;
      justify-content: flex-start;
      height: 100%;
      position: relative;
    }
    .title .left {
      left: 200px;
    }
    .title .right {
      right: 200px;
    }

    @keyframes squiggling {
      0% {
        filter: url("#turbulence-1");
      }
      20% {
        filter: url("#turbulence-2");
      }
      40% {
        filter: url("#turbulence-3");
      }
      60% {
        filter: url("#turbulence-4");
      }
      80% {
        filter: url("#turbulence-5");
      }
    }

    @keyframes rotation {
      from {
        transform: rotate(0deg);
      }
      to {
        transform: rotate(359deg);
      }
    }
  </style>
</head>
